import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const h=JSON.parse('{"title":"§ 55.1-2600 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2600.md","filePath":"vacode/55.1-2600.md"}'),i={name:"vacode/55.1-2600.md"},r=o('<h1 id="§-55-1-2600-definitions" tabindex="-1">§ 55.1-2600 Definitions. <a class="header-anchor" href="#§-55-1-2600-definitions" aria-label="Permalink to &quot;§ 55.1-2600 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Loaned property&quot; means all museum property deposited on or after July 1, 2002, with a museum not accompanied by a transfer of title to the property.</p><p>&quot;Museum&quot; means an institution located in the Commonwealth and operated by a nonprofit corporation or public agency whose primary purpose is educational, scientific, or aesthetic and that owns, borrows, or cares for and studies, archives, or exhibits museum property.</p><p>&quot;Museum property&quot; means all tangible objects, animate and inanimate, under a museum&#39;s care that have intrinsic value to science, history, art, or culture, except for botanical or zoological specimens loaned to a museum for scientific research.</p><p>2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0883" target="_blank" rel="noreferrer">883</a>, § 55-210.31; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',6),n=[r];function s(c,p,u,l,d,m){return t(),a("div",null,n)}const _=e(i,[["render",s]]);export{h as __pageData,_ as default};
